function arrayDiffer(a, b) {
    /*eslint eqeqeq:0*/
    if (a == null || b == null) {
        return true;
    }
    if (a.length !== b.length) {
        return true;
    }
    for (var i = 0; i < a.length; i++) {
        if (a[i] !== b[i]) {
            return true;
        }
    }
    return false;
}

function fontDiffer(a, b) {
    if (a === b) {
        return false;
    }

    return a.fontSize !== b.fontSize ||
        a.fontFamily !== b.fontFamily ||
        a.fontStyle !== b.fontStyle ||
        a.fontWeight !== b.fontWeight;
}

