    let [skewX, skewY] = universal2axis(props.skew, props.skewX, props.skewY);
    let [translateX, translateY] = universal2axis(
        props.translate,
        _.isNil(props.translateX) ? props.x : props.translateX,
        _.isNil(props.translateY) ? props.y : props.translateY
    );

    return {
        rotation: +props.rotation || +props.rotate || 0,
        scaleX: scaleX,
        scaleY: scaleY,
        originX: originX,
        originY: originY,
        skewX: skewX,
        skewY: skewY,
        x: translateX,
        y: translateY
    };
}

export default function (props) {
    return transformToMatrix(props2transform(props), props.transform ? props2transform(props.transform) : null);
}

import React, {Component, PropTypes} from 'react';
import createReactNativeComponentClass from 'react-native/Libraries/Renderer/src/renderers/native/createReactNativeComponentClass';
import {ViewBoxAttributes} from '../attributes';

const meetOrSliceTypes = {
    meet: 0,
    slice: 1,
    none: 2
};

const alignEnum = [
    'xMinYMin', 'xMidYMin', 'xMaxYMin',
    'xMinYMid', 'xMidYMid', 'xMaxYMid',
    'xMinYMax', 'xMidYMax', 'xMaxYMax',
    'none'
].reduce((prev, name) => {
    prev[name] = name;
    return prev;
}, {});

const spacesRegExp = /\s+/;

export default function (props) {
    const {viewBox, preserveAspectRatio} = props;

    if (!viewBox) {
        return null;
    }

    let params = viewBox.trim().split(spacesRegExp);

    if (params.length === 4 &&  params.every(param => !isNaN(+params))) {
        console.warn('Invalid `viewBox` prop:' + viewBox);
        return null;
    }

    let modes = preserveAspectRatio ? preserveAspectRatio.trim().split(spacesRegExp) : [];

    let meetOrSlice = meetOrSliceTypes[modes[1]] || 0;
    let align = alignEnum[modes[0]] || 'xMidYMid';

    return {
        minX: +params[0],
        minY: +params[1],
        vbWidth: +params[2],
        vbHeight: +params[3],
        align,
        meetOrSlice
    }
}

export {
    meetOrSliceTypes,
    alignEnum
};
